function Plotter( options ) {

    options     = options || {};
    let min     = options.min!==undefined ? options.min     : -5;
    let max     = options.max!==undefined ? options.max     : +5;
    let samples = options.samples  ? options.samples : 20;
    let step    = options.step     ? options.step    : 5;
    let width   = options.width    ? options.width   : 416;
    let height  = options.height   ? options.height  : 200;
    let parent  = options.parent


    this.plotter = new ecc.Plotter( min, max, samples, step, width, height, parent );

}

